import { HashRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import RoomsPage from "./modules/RoomsPage";
import RoomDetailsPage from "./modules/RoomDetailsPage";
import BookingPage from "./modules/BookingPage";
import PaymentPage from "./modules/PaymentPage";
import Dashboard from "./modules/Dashboard";
import NotFoundPage from "./modules/NotFoundPage";

export const Root = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<RoomsPage />} />
        <Route path="/rooms" element={<RoomsPage />} />
        <Route path="/book/:id" element={<RoomDetailsPage />} />
        <Route path="/payment/:roomId" element={<PaymentPage />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
    </Router>
  );
};
